import React from 'react';
import { Link } from 'react-scroll';

import HeaderLogo from '../01_global/HeaderLogo';

function HomeHeader(props) {
  return (
    <header className="home-header">
      <div className="container">
        <div className="header-left">
          <HeaderLogo color={'#888'} />
        </div>
        <nav className="header-center">
          {props.first && (
            <h6 className="section">
              <Link
                activeClass="active"
                to={props.first}
                spy={true}
                smooth={true}
                offset={-80}
                duration={500}
              >
                {props.first}
              </Link>
            </h6>
          )}
          {props.second && (
            <h6 className="section">
              <Link
                activeClass="active"
                to={props.second}
                spy={true}
                smooth={true}
                offset={-80}
                duration={500}
              >
                {props.third}
              </Link>
            </h6>
          )}
          {props.third && (
            <h6 className="section">
              <Link
                activeClass="active"
                to={props.third}
                spy={true}
                smooth={true}
                offset={-80}
                duration={500}
              >
                {props.third}
              </Link>
            </h6>
          )}
        </nav>
        <div className="header-right">{/* <h6>dark mode</h6> */}</div>
      </div>
    </header>
  );
}

export default HomeHeader;
